import React from "react";
import Block from "./Block";

const Group = ({ items, filter, param2, blockWidth, blockHeight }) => (
  <g>
    {items.map((item, index) => (
      <Block
        item={item}
        filter={filter}
        param2={param2}
        blockWidth={blockWidth}
        blockHeight={blockHeight}
        key={"block_" + item.id}
      />
    ))}
  </g>
);

export default Group;
